import { Avatar } from '@material-ui/core';
import React from 'react';
import "./Chat.css";

function Chat() {
    return (
        <div className="chat">
       <div class="chat__header">
      <Avatar/>
      <div class="chat__headerInfo">
        <h3>Room name</h3>
        <p>Last seen at...</p>
      </div>
      .chat__
       </div>
        </div>
    )
}

export default Chat;
